export const ReturnModal = ({ history }) => (
    <>
        {console.log(history)}
        <div className="modal">
            <div className="podcast">
                <nav onClick={() => history.back()}>
                    <a className="close">&lt; Volver</a>
                </nav>
            </div>
        </div>

        <style>
            {`
            nav {
                    background: none;
                }
                nav a {
                    display: inline-block;
                    padding: 15px;
                    color: white;
                    cursor: pointer;
                    text-decoration: none;
                }`}
        </style>
    </>
);
